function Knowledge() {
    
    return(
        <div id="experience" className="">
            <h2>Knowledge</h2>
            <ul className="list-group">
                <li className="list-group-item">Languages</li>
                <ul className="list-group">
                    <li className="list-group-item">Langs</li>
                    <li className="list-group-item">Exp</li>
                    <li className="list-group-item">Certs</li>
                </ul>
            </ul>
        </div>
    )
}//end method

export default Knowledge;
